package main

import "testing"

var tests = []struct {
	S    string
	want string
}{
	{"banana", "ana"},
	{"bananabomomo", "ana"},
	{"abcd", ""},
	{"", ""},
	{"", "maoli"},
	{"", "luqvg"},
}

func TestLongestDupSubstring(t *testing.T) {
	for _, test := range tests {
		if got := longestDupSubstring(test.S); got != test.want {
			t.Errorf("longestDupSubstring(%q) = %q; want %q\n", test.S, got, test.want)
		}
	}
}
